import React from "react";
import Navbar from "./Navbar";
import MyButton from "./MyButton";
import Footer from "./Footer";

function App() {
  const handleClick = (msg: string) => {
    alert(msg);
  };

  return (
    <div>
      <Navbar />
      <div style={{ padding: "20px", textAlign: "center" }}>
        <h1 id="home">Welcome to My React + TypeScript Website!</h1>
        <p>This is a simple multi-section website built with React + TS.</p>

        {/* Buttons */}
        <MyButton title="Say Hello" onClick={() => handleClick("Hello from React!")} />
        <MyButton title="Disabled Button" disabled={true} />

        {/* About Section */}
        <section id="about" style={{ marginTop: "40px" }}>
          <h2>About</h2>
          <p>This website was built step by step using React and TypeScript in VS Code.</p>
        </section>

        {/* Contact Section */}
        <section id="contact" style={{ marginTop: "40px" }}>
          <h2>Contact</h2>
          <p>Email: example@email.com</p>
        </section>
      </div>
      <Footer />
    </div>
  );
}

export default App;
